using namespace std;

typedef long long LL;

int main() {
#ifdef ExRoc
    freopen("test.txt", "r", stdin);
#endif  // ExRoc
    ios::sync_with_stdio(false);

    LL x = 15 * 233333 * 2;
    LL y = 17 * 343720 * 2;
    LL g = __gcd(x, y);
    LL lcm = x / g * y;
    LL a = lcm / x;
    LL b = lcm / y;
    double ans = sqrt(233333 * a * 2 * 233333 * a * 2 + 343720 * b * 2 * 343720 * b * 2);
    printf("%.2f\n", ans);

    return 0;
}

