#include <bits/stdc++.h>
using namespace std;

typedef long long LL;
int ans;
LL p[20];

LL getHash(int x, int y) {
    LL ret = 0;
    while (x != 0) {
        ret += p[x % 10];
        x /= 10;
    }
    while (y != 0) {
        ret += p[y % 10];
        y /= 10;
    }
    return ret;
}

bool judge(int x) {
    LL xHash = getHash(x, 0);
    for (int i = 2; i <= x / i; ++i) {
        if (x % i == 0) {
            if (getHash(i, x / i) == xHash) {
                return true;
            }
        }
    }
    return false;
}

